(function(global) {
	var TC = TC || {},

	toString = Object.prototype.toString;
	// hasOwnProperty = Object.prototype.hasOwnProperty,
	// push = Array.prototype.push,
	// slice = Array.prototype.slice,
	// indexOf = Array.prototype.indexOf;

	TC.version = '0.0.2';

	TC.noop = function() {
	};

	TC.type = function(obj) {
		var type;
		if (obj == null) {
			type = String(obj);
		} else {
			type = toString.call(obj).toLowerCase();
			type = type.substring(8, type.length - 1);
		}
		return type;
	}

	TC.extend = function() {
		var src, options, name, copy, clone, target = arguments[0] || {}, i = 1, length = arguments.length, deep = false;

		if (typeof target === "boolean") {
			deep = target;
			target = arguments[i] || {};
			i = 2;
		}
		if (typeof target !== "object" && !TC.isFunction(target)) {
			target = {};
		}
		// 默认扩展自身TC
		if (i === length) {
			target = this;
			i--;
		}
		for (; i < length; i++) {
			if ((options = arguments[i]) != null) {
				for (name in options) {
					src = target[name];
					copy = options[name];
					// 防止死循环
					if (target === copy) {
						continue;
					}
					if (deep && copy && typeof copy === "object" && !copy.nodeTCype) {
						if (TC.isArray(copy)) {
							clone = src && TC.isArray(src) ? src : [];
						} else {
							clone = src && (typeof src === "object" && !src.nodeTCype) ? src : {};
						}
						target[name] = TC.extend(deep, clone, copy);

					} else if (copy !== undefined) {
						target[name] = copy;
					}
				}
			}
		}
		return target;
	}

	// avalon 获取vm
	TC.getVm = function(name) {
		return avalon.vmodels[name];
	}

	// 暴露给全局变量
	global.TC = TC;

	// 脚本中的路径资源 标记作用 用于后期构建替换
	global.__uri = function(path) {
		return path
	}
	var _console = {
		log : function() {
		}
	}
	global.console = global.console || _console;

})(window);

/** ******* 判断相关常用方法 ****** */
;
(function(TC) {
	TC.extend({
		// 判断是否为空（undefined/null/空字符） 注意不包含空白字符
		isEmpty : function(str) {
			return str === undefined || str === null || str === '';
		},
		isString : function(obj) {
			return typeof obj == "string";
		},
		isObject : function(obj) {
			return typeof obj == "object";
		},
		isArray : function(obj) {
			return Object.prototype.toString.call(obj) === "[object Array]";
		},
		isFunction : function(obj) {
			return toString.call(obj) === "[object Function]";
		},
		isInt : function(str) {
			return /^(-|\+)?\d+$/.test(str);
		},
		// 判断是否为正数
		isBigZero : function(str) {
			return /^\d+$/.test(str);
		},
		isFloatOne : function(str) {
			return /^-?\d+\.?\d{0,1}$/.test(str);
		},
		// 判断是否为负数
		isLessZero : function(str) {
			return /^-\d+$/.test(str);
		},
		// 判断是否为float型数值
		isFloat : function(str) {
			return /^(-?\d+)(\.\d+)?$/.test(str);
		},
		// 判断是否为非负数
		isNoLessZero : function(str) {
			return /^\d+(\.?\d+)?$/.test(str);
		},
		isEmail : function(str) {
			var pattern = /^[a-zA-Z0-9_\-]{1,}@[a-zA-Z0-9_\-]{1,}\.[a-zA-Z0-9_\-.]{1,}$/;
			return pattern.test(str);
		},
		isPhone : function(str) {
			var reg = /(^[0-9]{3,4}\-[0-9]{3,8}$)|(^[0-9]{3,8}$)|(^\([0-9]{3,4}\)[0-9]{3,8}$)|(^0{0,1}13[0-9]{9}$)/;
			return reg.test(str);
		},
		isMobile : function(str) {
			var reg = /^(13|14|15|18)[0-9]{9}$/;
			return reg.test(str);
		},
		// 是否为中文
		isChinese : function(str) {
			var pattern = /[^\x00-\xff]/g;
			return pattern.test(str);
		},
		isQQ : function(str) {
			return /^\d{5,9}$/.test(str);
		},
		/**
		 * 是否在指定dom中
		 */
		inDomScope : function(curr, target) {
			if (!curr || !target)
				return false
			curr = typeof curr === 'string' ? $(curr) : curr
			if (curr.hasClass(target) || curr.attr("id") == target)
				return true
			var tg = curr.parents(target)
			return tg && tg.length
		}
	})
})(TC);

