(function(TC) {
	function _serialize(obj, $form, namespace) {
		var hasOwnProperty = Object.prototype.hasOwnProperty, k, v

		namespace = namespace ? namespace + '.' : '';
		for (k in obj) {
			if (hasOwnProperty.call(obj, k)) {
				v = obj[k];
				if (TC.isArray(v)) {
					v.forEach(function(el, i) {
						_serialize(el, $form, namespace + k + '[' + i + ']')
					});
				} else if (TC.type(v) === 'object') {
					_serialize(v, $form, namespace + k)
				} else {
					$('<textarea/>').attr('name', namespace + k).val(v).appendTo($form)
				}
			}
		}
	}
	TC.extend({
		serialize : function(obj, namespace, $form) {
			var hasOwnProperty = Object.prototype.hasOwnProperty, $form = $form || $('<form></form>'), k, v

			namespace = namespace ? namespace + '.' : '';
			for (k in obj) {
				if (hasOwnProperty.call(obj, k)) {
					v = obj[k];
					if (TC.isArray(v)) {
						v.forEach(function(el, i) {
							_serialize(el, $form, namespace + k + '[' + i + ']')
						});
					} else if (TC.type(v) === 'object') {
						_serialize(v, $form, namespace + k)
					} else {
						$('<input/>').attr('name', namespace + k).val(v).appendTo($form)
					}
				}
			}

			return $form.serialize()
		},
		// 模拟原生表单提交
		formSubmit : function(url, method, data) {
			var $form = $('<form></form>', {
				'method' : method,
				'action' : url
			});
			_serialize(data, null, $form)
			$form.css('display', 'none').appendTo($('body')) // ie 下必须插入文档后提交
			.submit()
		}
	})
})(TC);

