// 屏蔽浏览器backspace 键回退 点击 space 默认点击上一个按钮
document.onkeydown = function(event) {
	event = event ? event : window.event
	var code = event.keyCode || event.which, tag = event.srcElement.tagName.toUpperCase()

	if ((code == 8 || code == 32 || code == 13) && tag != "INPUT" && tag != "TEXTAREA" && tag != "TEXT") {
		event.returnValue = false;
		return false
	}
}

function isEmpty(obj, trim) {
	if (null === obj || undefined === obj) {
		return true;
	}
	trim = !trim ? true : trim;
	var type = typeof obj;
	if (type == 'string') {
		if (trim) {
			return obj.trim().length == 0;
		} else {
			return obj.length == 0;
		}
	} else if (isArray(obj)) {
		return obj.length == 0;
	} else if (type == 'object') {
		return $.isEmptyObject(obj);
	}
}

// 生成url请求结尾字符串（?temp=xxxx，防止浏览器缓存不请求）
function generateUrlEndStr() {
	return "?temp=" + new Date().getTime();
}

function timestampUrl(url) {
	return url + generateUrlEndStr();
}

function showMessageByClass(json, objId, time) {
	var tip = $("#" + objId);
	if (tip != null) {
		if (typeof json === "string") {
			tip.html(json);
		} else if (json != null) {
			if (typeof json.message === "string") {
				tip.html(json.message);
			} else {
				var message = "";
				$.each(json.message, function(index) {
					message += json.message[index] + " | ";
				});
				tip.html(message.substring(0, message.length - 3));
			}
		}
		tip.stop().slideDown().delay(!time ? SHOW_ERROR_INTERVAL_TIME : time).slideUp();
	}
}

function showTipMessage(meg, dialog) {
	var tip = $(dialog).find("div[class='tip css3_2 shake']").first();
	if (tip != null && typeof meg === "string") {
		$(tip).html(meg);
	} else if (tip != null && meg != null) {
		var message = "";
		$.each(meg.message, function(index) {
			message += meg.message[index] + "<br/>";
		});
		$(tip).html(message);
	}
	$(tip).stop().slideDown().delay(SHOW_ERROR_INTERVAL_TIME).slideUp();
}

function showSingleTip(msg, $alert) {
	$alert.html(msg);
	$alert.stop().slideDown().delay(SHOW_ERROR_INTERVAL_TIME).slideUp();
}

function alwaysShowSingleTip(msg, $alert) {
	$alert.html(msg);
	$alert.slideDown();
}

function lenc(s) {
	return s.replace(/[^\x00-\xff]/g, "xx").length;
}

function setMaxLength(divId, max) {
	var content = $(divId).val();
	var allNum = content.getBytes();
	if (max < allNum)
		return false;
	else
		return true;
}

/**
 * 为所选择控件绑定日历
 * 
 * @param parentSelector
 * @param startSelector
 * @param endSelector
 * @param isSelectableBCT
 */
function bindingDatepictureOnload(parentSelector, startSelector, endSelector, isSelectableBCT) {
	var parent = typeof parentSelector == 'string' ? $(parentSelector) : parentSelector;
	var starts = parent.find(startSelector);
	var ends = parent.find(endSelector);
	// 绑定开始日期的日历控件
	$.each(starts, function(i, item) {
		bindingDatepickerByElement($(item), true, startSelector, endSelector, isSelectableBCT, null, true);
	});
	// 绑定结束日期的日历控件
	$.each(ends, function(i, item) {
		bindingDatepickerByElement($(item), false, startSelector, endSelector, isSelectableBCT, null, true);
	});
}

/**
 * 绑定单个日历控件
 * 
 * @param ele
 *            要绑定日历控件的节点
 * @param isStartDate
 *            是否是开始时间
 * @param startSelector
 *            开始时间选择器
 * @param endSelector
 *            结束时间选择器
 * @param isSelectableBCT[BCT:before
 *            current time] 是否可选择今天之前的时间
 */
function bindingDatepickerByElement($ele, isStartDate, startSelector, endSelector, isSelectableBCT, callback, isRestrictEndDate) {
	var currStartDate = $ele[0].value;
	if (isStartDate) {
		$ele.datepicker({
			onSelect : function(dateText, inst) {
				// 动态改变结束时间的选择范围及显示
				var $this = $(this);
				// 记录当前触发事件的对象选择器至开始时间DOM属性active-selector
				$this.attr("active-selector", startSelector).attr("non-active-selector", endSelector);
				var $endDate = $this.siblings(endSelector);
				var currEndDate = $endDate.val();
				var cedIsEmpty = isEmpty(currEndDate);
				if (cedIsEmpty || TC.isChinese(currEndDate)) {
					$endDate.val(dateText).removeAttr("disabled").datepicker("option", "minDate", dateText);
				} else {
					var isGreatThan = cedIsEmpty || Date.parse(dateText) > Date.parse(currEndDate);
					$endDate.datepicker("option", "minDate", dateText);
					$endDate.val(isGreatThan ? dateText : currEndDate).removeAttr("disabled");
				}
				if (callback) {
					callback();
				}
			}
		});
		if (!isSelectableBCT) {
			var minDate;
			if (TC.isChinese(currStartDate) || currStartDate.notExist("-")) {
				minDate = new Date();
			} else {
				minDate = new Date(currStartDate.replace(/-/g, "/"));
			}
			$ele.datepicker("option", "minDate", minDate);
		}
	} else {
		$ele.datepicker({
			// minDate : date,
			onSelect : function(dateText, inst) {
				var $startDate = $(this).siblings(startSelector);
				// 记录当前触发事件的对象选择器至开始时间DOM属性active-selector
				$startDate.attr("active-selector", endSelector).attr("non-active-selector", startSelector);
				var val = $startDate.val();
				var valIsEmpty = isEmpty(val);
				if (valIsEmpty || TC.isChinese(val)) {
					$startDate.val(dateText);
				}
				if (callback) {
					callback();
				}
			}
		});
		if (isRestrictEndDate) {
			var minDate = new Date(), startDate;
			startDate = new Date($ele.siblings(startSelector).val().replace(/-/g, "/"));
			minDate = isValidDate(startDate) ? startDate : minDate;
			$ele.datepicker("option", "minDate", minDate);
		}
		if (isNaN(Date.parse($ele.val()))) {
			$ele.attr("disabled", "disabled");
		}
	}
}

