// 计算两个日期相差几天 格式：yyyy-MM-dd
Date.diffDays = function(date1, date2) {
	date1 = typeof date1 == 'string' ? new Date(date1.replace(/-/g, "/")) : date1;
	date2 = typeof date2 == 'string' ? new Date(date2.replace(/-/g, "/")) : date2;
	var date3 = date2.getTime() - date1.getTime();
	// 时间差的毫秒数
	var days = Math.floor(date3 / MILLION_SECONDS_OF_DAY);
	return days;
};

/**
 * 获取指定时间段内的时间值
 * 
 * @param date1
 *            开始时间
 * @param date2
 *            结束时间
 * @param resultType
 *            结果类型：['string','array']两种，默认stirng。
 * @param dataType
 *            【返回结果的】数据类型['string','date']两种，默认stirng。// TODO 注：只有resultType指定为'array'时，此参数才可指定为'date'
 * @param join
 *            当返回类型为string时的连接符，默认逗号','。
 */
Date.getDiffDays = function(date1, date2, resultType, dataType, join) {
	var rt = isNull(resultType) ? 'string' : resultType, dt = isNull(dataType) ? 'string' : (('date' == dataType && 'string' == resultType) ? 'string' : dataType);
	var d1t = typeof date1 == 'string', d2t = typeof date2 == 'string';
	var d1 = d1t ? new Date(date1.replace(/-/g, '/')) : date1, d2 = d2t ? new Date(date2.replace(/-/g, '/')) : date2;
	var diffDay = d1.diffDaysBy(d2);
	if (diffDay == 0) {
		return rt == 'string' ? (d1t ? date1 : date1.format(DEFAULT_DATE_FORMAT)) : ([ dt == 'string' ? (d1t ? date1 : date1.format(DEFAULT_DATE_FORMAT)) : (d1t ? d1 : date1) ]);
	}
	var addDay = diffDay > 0 ? 1 : -1, dateArr = [], addDate = null;
	dateArr.push(d1);
	for (var i = 1; i <= diffDay; i++) {
		addDate = new Date();
		addDate.setDate(d1.getDate() + i * addDay);
		dateArr.push(addDate);
	}
	if (rt == 'string') {
		return convertDateToString(dateArr).join(isNull(join) ? ',' : join);
	}
	if (dt == 'string') {
		return convertDateToString(dateArr);
	}
	return dateArr;
};

